const Config = {
  initialMessages: [createChatBotMessage(`Namaste`)],
  botName: botName,
  customComponents: {
    botAvatar: (props) => (
      //   <Avatar sx={{ background: "black" }}>
      <img src={logo} alt="avatar" />
      //   </Avatar>
    ),
    userAvatar: (props) => <Avatar sx={{ background: "orange" }}></Avatar>,
  },
};

export default Config;
